"""### **Ejercicio 1 - Comparaci√≥n con Jhonson**
![Ejercicio 1.JPG](data:image/jpeg;base64,)
"""

from itertools import product

n = 8 # Cantidad de autos
m = 3 # Reparado, Pintado y Tapizado

tiempos = [[85, 23, 21],  #A1
         [32, 56, 26],  #A2
         [43, 12, 19],  #A3
         [51, 34, 82],  #A4
         [40, 33, 0],  #A5
         [77, 9 , 9],  #A6
         [60, 23, 2],  #A7
         [27, 15, 29]]  #A8

maquina = [[0, 1, 2],  #Orden del auto 1
            [0, 1, 2],  #Orden del auto 2
            [0, 1, 2],  #Orden del auto 3
            [0, 1, 2],  #Orden del auto 4
            [0, 1, 2],  #Orden del auto 5
            [0, 1, 2],  #Orden del auto 6
            [0, 1, 2],  #Orden del auto 7
            [0, 1, 2]]  #Orden del auto 8


M = sum(times[i][k] for i in range(n) for k in range(m)) #Big M

#1. Definici√≥n del modelo
modelo = Model ('JSSP')   

#2. Variables
C = modelo.add_var(name = "C")

x = [[modelo.add_var(name = 'x({}, {})'.format(i+1, k+1))
        for k in range(m)] for i in range(n)]

y = [[[modelo.add_var(var_type = BINARY, name = 'y({}, {}, {})'.format(i+1, j+1, k+1))
        for k in range(m)] for j in range(n)] for i in range(n)]

z = [[[modelo.add_var(var_type = BINARY, name = 'z({}, {}, {})'.format(i+1, k+1, k2+1))
        for k2 in range(m)] for k in range(m)] for i in range(n)]

#3. Funci√≥n Objetivo
modelo.objective = C

#4. Restricciones

    #1. Donde se define C como la suma del tiempo que demora en procesar mas el tiempo inicial en que comienza
#for (i,k) in product(range(n), range(m)):
    #O += c >= x[i][k] + times[i][k]

for i in range(n):
  modelo +=C >= x[i][maquina[i][m-1]] + tiempos[i][maquina[i][m-1]]

    #2 y 3. Solo puede haber un auto en cada m√°quina
for (i,j) in product(range(n), range(n)):
    if  j!=i :
      for k in range(m):
        modelo += x[i][k] - x[j][k] + M*y[i][j][k] >= tiempos[j][k]
        modelo += -x[i][k] + x[j][k] - M*y[i][j][k] >= tiempos[i][k] - M

    #4 y 5. Un auto se procesa en una sola m√°quina a la vez
for (i,k) in product(range(n), range(1,m)):
    modelo += x[i][maquina[i][k]] >= x[i][maquina[i][k-1]] + tiempos[i][maquina[i][k-1]]

#5. Resolver
modelo.optimize()

print("Tiempo de apertura: ", C.x)
for (i, k) in product(range(n), range(m)):
    print("Auto %d comienza en el proceso %d en el tiempo %g " % (i+1, k+1, x[i][k].x))

