"""### **Ejercico 3 - Job Shop Scheduling**
![Ejercicio 3.JPG](data:image/jpeg;base64,)
"""

from itertools import product
from mip import Model, maximize, BINARY
import numpy as np
#from time import time

n = 10 #tareas
m = 5  #maquinas
         #M0-M1-M2-M3
times = [[20, 31, 17, 87, 76],
         [24, 18, 32, 81, 25],
         [58, 72, 23, 99, 28],
         [45, 76, 86, 90, 97],
         [42, 46, 17, 48, 27],
         [98, 67, 62, 27, 48],
         [80, 12, 50, 19, 28],
         [94, 63, 98, 50, 80],
         [75, 41, 50, 55, 14],
         [61, 37, 18, 79, 72]]

B = sum(times[i][j] for i in range(n) for j in range(m))

#orden en el que se necesitan realizar los trabajos en las m√°quinas
            #1ero-2d0-3ro
machines = [[0, 3, 1, 4, 2],
            [4, 2, 0, 1, 3],
            [1, 2, 4, 0, 3],
            [2, 1, 4, 0, 3],
            [4, 0, 3, 2, 1],
            [1, 0, 4, 3, 2],
            [4, 1, 3, 0, 2],
            [1, 0, 2, 3, 4],
            [4, 0, 2, 1, 3],
            [4, 2, 1, 3, 0]]
#1. DEFINICI√ìN DEL MODELO
model = Model('JSSP')

#2. VARIABLES
c = model.add_var(name="C")
x = [[model.add_var(name='x({},{})'.format(j+1, i+1)) for i in range(m)] for j in range(n)] #tiempo de inicio del trabajo j en la m√°quina i
y = [[[model.add_var(var_type=BINARY, name='y({},{},{})'.format(j+1, k+1, i+1)) #que toma valor 1 si el trabajo  j  precede al trabajo  k  en la m√°quina  i .
    for i in range(m)] for k in range(n)] for j in range(n)]
#j y k  tareas - i M√°quinas

#3. FUNCI√ìN OBJETIVO
model.objective = c

#4. RESTRICCIONES
#Primera restricci√≥n
for j in range(n):                          # times[0][Machines[0][1]] = Times[0][0] = 3
    model += c >= x[j][machines[j][m - 1]] + times[j][machines[j][m - 1]] ## C debe ser mayor o igual al (√∫ltimo) tiempo de inicio + el tiempo que demora.
                  #Tiempo de inicio de la tarea J en su √∫ltima m√°quina +....  

#Segunda y tercera restricci√≥n
for (j, k) in product(range(n), range(n)):
    if k != j:
        for i in range(m):
            model += x[j][i] - x[k][i] + B*y[j][k][i] >= times[k][i]
            model += -x[j][i] + x[k][i] - B*y[j][k][i] >= times[j][i] - B

#Cuarta restricci√≥n
for (j, i) in product(range(n), range(1, m)):
    model += x[j][machines[j][i]] >= x[j][machines[j][i-1]] + times[j][machines[j][i-1]]## [machines[0][1]]== machines[fila 0][columna 1] = 0 
    
#5. RESOLVER
model.optimize()

#Imprimir resultados
print("Tiempo de ejecuci√≥n:", c.x)
for (j, i) in product(range(n), range(m)):
  print("Tarea %d comienza en m√°quina %d en el tiempo %g"% (j+1, i+1, x[j][i].x))

